@nunompmoniz If they do the job for you (fast enough): use them. 

They are well-tested, reliable, and #Rstats will always be there for you with them.

A good one-dependency alternative is data.table::fread() which reads in parallel and is clever about formats.  And 'tidy' vroom + readr.

@PipingHotData maybe shorter option:

`%ne%` &lt;- function(x,y){
  z &lt;- x!=y
  return(https://t.co/uK811pQ0vW(z) | z)
}

